  render() {
    console.log(this.props);
    const { name, imgsrc, imgalt, title, strbody, btncaption } = this.props;
    return (
      <div className="card">
        <div className="card-header">{this.props.cardInfo.name}</div>
        <img
          className="card-img-top"
          src={this.props.cardInfoimgsrc}
          alt={imgalt}
        />
        <div className="card-body">
          <h5 className="card-title">{this.props.cardInfotitle}</h5>
          <p className="card-text">{this.props.cardInfostrbody}hola</p>
          <Link href="/contact">
            <a className="btn btn-outline-primary">{btncaption}</a>
          </Link>
        </div>
      </div>
    );
  }
}

export default Card;
